      SELECT DISTINCT + - 25, - col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 + - - col1 * ( col2 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q9439.out
    data: |
      -25	-46
      -25	-64
      -25	-75
